function Snake(t){var n;return this.init=function(t){return n=[[t/2,t/2]],this},this.head=function(){return n[0]},this.move=function(t){var i=this.head();i=[i[0]+t[0],i[1]+t[1]],n.unshift(i),n.pop()},this.hitSelf=function(){for(var t=1;t<n.length;t++)if(Utils.arraysEqual(this.head(),n[t]))return!0;return!1},this.remove=function(){$(".snake").removeClass("snake")},this.display=function(){this.remove();for(var t=0;t<n.length;t++)Utils.cell(n[t]).addClass("snake")},this.getLocations=function(){return n},this.lengthen=function(t){t=[-1*t[0],-1*t[1]];var i=[this.head()[0]+t[0],this.head()[1]+t[1]];n.push(i)},this.hitCell=function(t){return Utils.arraysEqual(this.head(),t)},this.hasBody=function(){return 1<n},this.init(t)}